import React from "react";
// import { selectCount } from "../../Redux/Counter";

const [count,setCount]=React.useState(0);

const Page= (props) => {
  return (
    <div>
      {props.children}

      <h1>The count is {count}</h1>
      <button onClick={()=>setCount(count+1)}>increment</button>
      <button onClick={()=>setCount(count-1)}>increment</button>
    </div>
  );
};

export default Page;
